import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

export default function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/CurrentLocation">CurrentLocation</Link>
            </li>
            <li>
              <Link to="/ChangeLocation">ChangeLocation</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/CurrentLocation">
            <CurrentLocation />
          </Route>
          <Route path="/ChangeLocation">
            <ChangeLocation />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function CurrentLocation() {
  return <h2>CurrentLocation</h2>;
}

function ChangeLocation() {
  return <h2>ChangeLocation</h2>;
}
